import React from "react";
import { Col, Row } from "react-bootstrap";
import { useSelector } from "react-redux";
import { LojaFiltro } from "./LojaFiltro";

export const LojaFilters = () => {
  let filtros = useSelector((state) => state.loja.filtros);
  let filtrosKeys = Object.keys(filtros);

  return (
    <div className="bodie">
      <Row className="justify-content-center align-content-start">
        <Col xs={true}>
          {filtrosKeys.map((filtroKey) => {
            console.log(filtros[filtroKey]);
            return (
              <LojaFiltro titulo={filtroKey} filtros={filtros[filtroKey]} />
            );
          })}
          {/* <h5></h5>
          <input type="checkbox" id="vehicle1" name="vehicle1" value="Bike" />
          <label for="vehicle1"> I have a bike</label> */}
        </Col>
      </Row>
    </div>
  );
};
